import { createIcon } from "../icon/createIcon";

export const HomeSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="HomeSolidIcon">
    <path d="M9.964 5.139V12H6.991V9.99H5.009V12H2.036V5.138l-1.107.897L0 4.86 5.999 0 12 4.86l-.929 1.175z" />
  </svg>,
  "HomeSolid",
  "home solid"
);
